import React from "react";
import Header from "../components/Header";
import Footer from "../components/Footer";

const Home: React.FC = () => {
    return (
        <>
            <Header />
            <main className="bg-gray-100 text-center py-20">
                <h1 className="text-4xl font-bold mb-4">Welcome to FindWorker</h1>
                <p className="text-lg text-gray-700 mb-8">
                    Find the right labor for your job or showcase your skills to potential employers.
                </p>
                <a
                    href="/search"
                    className="bg-blue-600 text-white py-2 px-6 rounded shadow hover:bg-blue-700"
                >
                    Get Started
                </a>
            </main>
            <Footer />
        </>
    );
};

export default Home;
